class GaydarSound {
    constructor(defaultURL) {
        this.sound = defaultURL?defaultURL:"./src/sounds/grindr.ogg";
    }
    set sound(soundURL) {
        this._sound = new Audio(soundURL);
        this._loopCount = 0;
    }
    get sound() {
        return this._sound;
    }
    get loopCount() {
        return this._loopCount;
    }
    play(loop) {
        if(loop) {
            this._dontLoopWorkArround = false;
            this._sound.addEventListener('ended', (e) => {
                if(!this._dontLoopWorkArround) {
                    console.log(e)
                    this._sound.play();
                    this._loopCount++;
                }
            });
        }
        //initial play
        this._sound.play();
        this._loopCount = 0;
    }
    stop(playThrough) {
        this._dontLoopWorkArround = true;
        if(!playThrough) {
            this._sound.pause();
            this._sound.currentTime = 0;
        }
        this._sound = this._sound.cloneNode(true);
    }
}

